function deleteConfirm(route) {
    Swal.fire({
        title: ' ?',
        text: "    !",
        showCancelButton: true,
        confirmButtonText: '',
        cancelButtonText: '',
    }).then((result) => {
        if (result.isConfirmed) {
            $.ajax({
                url: route,
                type: 'DELETE',
                data: {"_token": $('meta[name="csrf-token"]').attr('content')},
                success: function(result) {
                    Swal.fire(result, '', 'success').then((result) => {
                        location.reload();
                    });
                },
                error: function(result) {
                    Swal.fire('!  !', '', 'error')
                }
            });

        }
    })
}